import React, { useEffect, useState } from 'react';
import { render } from 'react-dom';
import '../TimerCounter/Counter.css';

class Kick extends React.Component {  
  constructor(props){  
    super(props);  
    this.state = {  
         data: 'www.javatpoint.com'  
      }  
    this.handleEvent = this.handleEvent.bind(this);  
  }  
  handleEvent(){  
    console.log(this.props);  
  }  
  render() {  
    return (  
      <>
      <div className="App">  
    <h2>Kick Counter</h2>  
      </div>  
      <div>0</div>
      <div>0</div>
      <div>0</div>
      <div>0</div>
      <div>
        <button>RESET</button>
        <button>START</button>
        <button>STOP</button>
      </div>
      </>
    );  
  }  
}  
export default Kick;
